import torch 
import torch.nn as nn

# Model definition

class DeepBiaffineDecoder(nn.Module):
    def __init__(self, input_in_dim:int, input_hidden_arc_dim:int, input_includes_roots:bool = False) -> nn.Module:
        '''See more on : https://nlp.stanford.edu/pubs/dozat2017deep.pdf
        This class is a Dozat and Manning layer adapted from the LIMA project.'''
    
        super(DeepBiaffineDecoder, self).__init__()
        # parameters of the model
        self.includes_roots = input_includes_roots
        self.in_dim = input_in_dim
        self.hidden_arc_dim = input_hidden_arc_dim
        self.elu = nn.functional.elu
        # design of the model
        self.mlp_head = nn.Linear(self.in_dim,self.hidden_arc_dim)
        self.mlp_dep = nn.Linear(self.in_dim, self.hidden_arc_dim)

        self.U1 = torch.empty(self.hidden_arc_dim, self.hidden_arc_dim)
        self.u2 = torch.empty(self.hidden_arc_dim,1)
        self.root = torch.empty(1,1,self.hidden_arc_dim)
        self.root2 = torch.empty(1,1,self.hidden_arc_dim)
        nn.init.xavier_uniform_(self.U1)
        nn.init.xavier_uniform_(self.u2)
        nn.init.xavier_uniform_(self.root)
        nn.init.xavier_uniform_(self.root2)


    def forward(self, input: torch.tensor):

        # Rq : Look for errors compared to Victor's code
        # batch_size = input.shape[0] # Rq : see during training for batch with shape[1]
        # input_t = input.transpose(0,1)

        # a changer selon le tokenizer, ici NllbTokenizer
        tokens = torch.FloatTensor( input['input_ids'] )
        batch_size = len(tokens)
        # tokens_t = tokens.transpose(0,1) # no need to transpose here

        if self.includes_roots:
            arc_head = self.elu(self.mlp_head(input))
        else :
            roots2 = self.root2.tile((batch_size, 1, 1))
            roots2 = roots2.view(roots2.size(0), -1)  # Reshape to match dimensionality
            arc_head = self.elu(torch.cat(( roots2, self.mlp_head(tokens) ), 1))
            
        
        if self.includes_roots :
            arc_dep = self.elu(self.mlp_dep(tokens))
        else :
            roots = self.root.tile(( batch_size, 1, 1 ))
            roots = roots.view(roots.size(0), -1)  # Reshape to match dimensionality
            arc_dep = self.elu(torch.cat(( roots, self.mlp_dep(tokens) ), 1))

        W = torch.matmul(arc_head, self.U1)
        b = torch.matmul(arc_head, self.u2.tile(( 1, arc_head.shape(1) )))
        Wx = torch.matmul(W, arc_dep.transpose(1, 2))
        r = torch.add(Wx, b)

        if not(self.includes_roots) :
            r = r[:, 1:, :]
            
        return r
    



